<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>Registration Code Generator</title>
  
<style>
  body {
    font-family: Arial, sans-serif;
    background: linear-gradient(135deg, #ff5f6d, #ffc371);
    margin: 0;
    min-height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
    color: white;
    text-align: center;
    padding: 20px;
  }

  .banana-container {
    background: rgba(255, 94, 98, 0.3);
    padding: 30px;
    border-radius: 15px;
    box-shadow: 0 0 30px rgba(255, 214, 165, 0.4);
    width: 100%;
    max-width: 400px;
  }

  h1, p {
    color: white;
    text-shadow: 0 0 10px #ffebcc;
  }

  .banana-box {
    background: rgba(255, 245, 200, 0.15);
    border: 1px solid rgba(255, 255, 255, 0.4);
    padding: 15px;
    border-radius: 8px;
    margin-top: 20px;
    font-size: 16px;
    color: white;
    word-wrap: break-word;
    text-shadow: 0 0 5px #ffeaa7;
  }

  button {
    background-color: #ff9a00;
    border: none;
    color: white;
    padding: 12px 20px;
    margin: 10px 5px 0;
    font-size: 16px;
    border-radius: 8px;
    cursor: pointer;
    box-shadow: 0 0 10px #ffb347;
    transition: 0.3s;
  }

  button:hover {
    background-color: #ff6f00;
    box-shadow: 0 0 20px #ffb347;
  }

  @media screen and (max-width: 480px) {
    .banana-container {
      padding: 20px;
    }
    button {
      width: 100%;
      margin-top: 10px;
    }
  }
</style>
  
</head>
<body>

  <div class="banana-container">

    <button onclick="copyBanana()">Copy Code</button>
    <div class="banana-box" id="banana-box"></div>
  </div>
